const getArtistID = async (name, token) => {
    console.log()
    console.log('https://api.spotify.com/v1/?q=' + {name} +'&type=artist');
    const res = await fetch('https://api.spotify.com/v1/?q=' + {name} +'&type=artist', {
      method: 'GET',
      headers: {
        'Authorization': {token},
      },
    });
    const results = await res.json();
    return results
}
